export default function FilterNames(props) {
  const sortedNames = props.names.sort((a, b) => {
    let fa = a.name;
    let fb = b.name;

    if (fa < fb) {
      return -1;
    }
    if (fa > fb) {
      return 1;
    }
    return 0;
  });
